import React from "react";
import { useNavigate } from "react-router-dom";
import "./landingPage.css";

const LandingPage = () => {
  const navigate = useNavigate();

  const navigateTo = (path) => {
    navigate(path);
  };

  return (
    <div className="landing-page">
      {/* Header */}
      <header className="header">
        <a href="#" className="logo">
          <i data-lucide="code"></i>
          <span>EventHive</span>
        </a>
        <nav className="nav">
          <a href="#">Find Partners</a>
          <a href="#">Hackathons</a>
          <a href="#">About</a>
        </nav>
      </header>

      {/* Hero Section */}
      <main className="main">
        <section className="hero">
          <h1>Find Your Perfect Hackathon Team</h1>
          <p>
            Connect with skilled developers, designers, and innovators. Build
            amazing projects together.
          </p>

          <div className="card">
            <h2>Join HackPartner</h2>
            <button
              onClick={() => navigateTo("/registration")}
              className="btn"
            >
              Sign Up
            </button>
            <button onClick={() => navigateTo("/login")} className="btn">
              Login
            </button>
          </div>
        </section>
      </main>

      {/* Footer */}
      <footer className="footer">
        <p>Â© 2024 HackPartner. All rights reserved.</p>
        <nav>
          <a href="#">Terms of Service</a>
          <a href="#">Privacy</a>
        </nav>
      </footer>
    </div>
  );
};

export default LandingPage;
